function profile_progress(){$(document).find(".profile_progress .step.__yes").length>0&&$(document).find(".profile_progress .step").each(function(e,s){e&&($(this).hasClass(".__yes")&&$(this).find("._tree span:eq(1)").css({"animation-delay":e+"s"}),$(this).find("._desc").css({"animation-delay":e+"s"}))}),$(document).find(".main_profile").length>0&&$(document).find(".main_profile ._profile_info ._points span").html(localStorage.getItem("user_points"))}